/**
 * Securely loads Firebase service account credentials from environment variables or file path.
 * Security measures:
 * - No sensitive credential data is logged to console
 * - Uses environment variables for configuration instead of hardcoded paths
 * - Provides clear error messages without exposing credentials
 *
 * Supported credential sources (in priority order):
 * 1. FIREBASE_SERVICE_ACCOUNT_KEY_BASE64 - Base64 encoded service account JSON
 * 2. FIREBASE_SERVICE_ACCOUNT_KEY - Raw JSON service account key
 * 3. FIREBASE_SERVICE_ACCOUNT_PATH - File path to service account JSON file
 */
const loadServiceAccount = (): admin.ServiceAccount => {
  try {
    // Check if we're using the Base64 encoded version (from Cloud Run)
    if (process.env.FIREBASE_SERVICE_ACCOUNT_KEY_BASE64) {
      try {
        const decodedKey = Buffer.from(
          process.env.FIREBASE_SERVICE_ACCOUNT_KEY_BASE64,
          'base64'
        ).toString('utf-8')

        const serviceAccountJson = JSON.parse(decodedKey)
        logger.debug('Service account loaded successfully from Base64 environment variable')

        // Firebase Admin SDK expects the JSON format directly, not the TypeScript interface
        return serviceAccountJson as admin.ServiceAccount
      } catch {
        logger.error('Error decoding Base64 service account key from environment variable')
        throw new Error('Failed to decode Base64 service account key')
      }
    }

    // Fall back to the regular environment variable if available
    if (process.env.FIREBASE_SERVICE_ACCOUNT_KEY) {
      try {
        const serviceAccountJson = JSON.parse(process.env.FIREBASE_SERVICE_ACCOUNT_KEY)
        logger.debug('Service account loaded successfully from JSON environment variable')

        // Firebase Admin SDK expects the JSON format directly, not the TypeScript interface
        return serviceAccountJson as admin.ServiceAccount
      } catch {
        logger.error('Error parsing JSON service account key from environment variable')
        throw new Error('Failed to parse JSON service account key')
      }
    }

    // Check for service account file path from environment variable
    const serviceAccountPath = process.env.FIREBASE_SERVICE_ACCOUNT_PATH
    if (serviceAccountPath && fs.existsSync(serviceAccountPath)) {
      try {
        const serviceAccountData = fs.readFileSync(serviceAccountPath, 'utf8')
        const serviceAccountJson = JSON.parse(serviceAccountData)
        logger.debug('Service account loaded successfully from file path', { serviceAccountPath })

        // Firebase Admin SDK expects the JSON format directly, not the TypeScript interface
        return serviceAccountJson as admin.ServiceAccount
      } catch {
        logger.error('Error reading service account file', { serviceAccountPath })
        throw new Error('Failed to read service account file')
      }
    }

    throw new Error(
      'Firebase service account key not found. Please set FIREBASE_SERVICE_ACCOUNT_KEY_BASE64, FIREBASE_SERVICE_ACCOUNT_KEY, or FIREBASE_SERVICE_ACCOUNT_PATH environment variable.'
    )
  } catch (error) {
    if (
      error instanceof Error &&
      error.message.includes('Firebase service account key not found')
    ) {
      throw error
    }
    logger.error('Error loading Firebase service account configuration')
    throw new Error('Failed to load Firebase service account configuration')
  }
}

// Initialize Firebase Admin only if not in test environment
if (process.env.NODE_ENV !== 'test' && !admin.apps.length) {
  try {
    const serviceAccount = loadServiceAccount()
    const serviceAccountRecord = serviceAccount as Record<string, unknown>

    // Only log non-sensitive information
    const clientEmail = serviceAccountRecord.client_email || serviceAccountRecord.clientEmail
    const projectId = serviceAccountRecord.project_id || serviceAccountRecord.projectId

    if (clientEmail) {
      logger.debug('Using service account', { clientEmail })
    }
    if (projectId) {
      logger.debug('For project', { projectId })
    }

    admin.initializeApp({
      credential: admin.credential.cert(serviceAccount),
    })

    // Test Firebase Auth availability
    try {
      const auth = admin.auth()
      logger.debug('Firebase Admin SDK initialized successfully')
      logger.debug('Firebase Auth instance available', { available: !!auth })
    } catch (authError) {
      logger.error('Firebase Auth instance creation failed', {
        error: authError instanceof Error ? authError.message : String(authError),
      })
      throw authError
    }
  } catch (error) {
    logger.error('Failed to initialize Firebase Admin SDK')

    if (error instanceof Error) {
      if (error.message.includes('insufficient permission')) {
        logger.error(
          'IAM Permission Error: The service account may lack required Firebase Authentication permissions.'
        )
        logger.error('Required roles: roles/firebase.authAdmin or roles/firebase.admin')
        logger.error('Please ensure the service account has the necessary permissions.')
      } else if (error.message.includes('Firebase service account key not found')) {
        logger.error(error.message)
      }
    }

    throw error
  }
}

